안녕하세오 숭아집사입니다.🙇🏻‍♀️
다름이 아니라 숭아를 키우게 된지 한달 반 정도가
지난 지금 숭아 계정에서 많은 분들과 소통하고
많은 정보도 얻고 또 숭아를 이뻐해주셔서
너무 감사한 마음에 저는 이른감이있지만
600팔로워에 이벤트를 진행하게 되었습니다.

제가 이벤트를 처음하는 부분에 있어 어설프거나 미숙한점 이해부탁드릴게요!

(숭아도 사용중인 제품입니다)

이벤트 상품💝 
1.구름 펜던트 인식표
2.하트 펜던트 인식표
3.하트하튜 인식표
3.무지개 스마일 인식표

