@hi_mungmoong 의 제품이며
자세한 사항은 하이멍뭉 피드에서 확인 가능합니다.
색과 디자인은 당첨자에 한해 선택 가능하며, 
전화번호와 이니셜 중 한가지만 새기실 수 있습니다.

