2.이벤트가 끝나고 팔로우취소하시는 분들은  추후 예정인 이벤트 참여대상에서도 앞으로도 제외🚫됩니다.

3.이벤트에 당첨되신 4명의 당첨자분들은 후기를 
🤙🏻꼬옥 🤙🏻 남겨주세요!

