🆘🆘 아픈 다리로 ✔철창에서 6년을 살았어요 ㅠㅠ 
임보해주실 분 계실까요? ㅠㅠ🆘🆘
.
저는 전문구조자도 아니고, 
일많은 직장 다니느라 제 시간도 빠듯하여
성아 입양보내면, 그 짐을 좀 덜자하고 생각했는데
이 아이가 너무 눈에 밟혀서 속상합니다. 
이슈가 된 아이도 아니고,
이미 6살이 되어 어린 강아지도 아니라서 입양보낼 수 있을지, 뒷다리는 또 어떨지 넘 막막한데,
6년동안 철창에 있었다고 하니 도저히 외면하기가 힘드네요. 
2주전부터 여기저기 임보처 구해보고 있지만 쉽지 않네요. 신청해놓고 잠수타신 분까지... 
아이는 아직도 시보호소에 있습니다. 
사랑으로 임보해주실 분 계시면 제가 이 아이 구조할께요. 아이 치료가 필요할 수 있어. 서울 경기권이면 좋겠습니다. 접종/치료비는 제가 다 부담하겠습니다. 
.

🌱이름 : 빈이
🌱나이 : 6살
🌱성별 : 암컷 (중성화 O)
🌱2015년 1월 13일 안서동 스타빌동보 인근에서 구조

6개월 때 보호소에 들어와서 5년 6개월째 보호소 철장 안에서 살고 있는 아이입니다.
구조당시 교통사고로 들어왔는데 제때 치료받지 못해서 한쪽 다리를 절뚝이게 되었어요.

6개월에 들어온 아이가 철장 안에서 6살이 되었어요..

🍀평생 가족 문의도 환영입니다

